(1, 0, 'UPDATE Semester SET Semester.StatusID = 2;', 'حماية بيانات الترم', 'True', '', '1.2', 'False'),
(2, 0, 'UPDATE Semester SET Semester.StatusID = 1\r\nWHERE (((Semester.Semester)=\"Spring2018\"));', 'فتح اخر ترم', 'True', '', '1.2', 'False'),
(3, 0, 'UPDATE student SET student.MilitaryEducationID = 1\r\nWHERE (((student.GenderID)=1))', '', 'True', '', '1.2', 'False'),
(4, 0, 'UPDATE student SET student.MilitaryEducationID = 2\r\nWHERE (((student.GenderID)=2));', 'اضافة التربية العسكرية', 'True', '', '1.2', 'False'),
(5, 0, 'UPDATE Course SET Course.CurriculumID = 1\r\nWHERE (((Course.CurriculumID) Is Null));', 'اضافة الائحة', 'True', '', '1.4', 'False'),
(6, 0, 'UPDATE student SET student.CurriculumID = 1\r\nWHERE (((student.CurriculumID) Is Null));', '', 'True', '', '1.4', 'False'),
(7, 0, 'UPDATE Registration SET Registration.AdvisorApprovalID = 2\r\nWHERE (((Registration.AdvisorApprovalID) Is Null));', 'Add approval status', 'True', '', '1.4', 'False'),
