(9, 0, 'UPDATE Faculty INNER JOIN (Curriculum INNER JOIN student ON Curriculum.ID = student.CurriculumID) ON Faculty.ID = Curriculum.FacultyID SET student.StudentEductionalNumber = [student].[StudentEductionalNumber] & \'_\' & Mid([Faculty].[FacultyName_English],1,4)\r\nWHERE (((student.StudentEductionalNumber) Is Null));', 'اضافة اسم الكلية الى رقم الطالب', 'False', '', '1.6', 'False');
